import React, { Component } from 'react';


export default class Fetch extends Component {

  componentDidMount() {
    fetch('/players/1')
      .then(response => response.json())
      .then(data => console.log(data.first_name))
  };
  ;
  render() {
    return (
      <div>
       console.log(data.first_name)
      </div>
    )
  }
}
